import ChatPage from './ChatPage';

const MemberPage = () => {
    const [notif,setNotif] = useState(null);

    useEffect(() => {
        setNotif(new WebSocket(`ws://localhost:8000/ws/chat/groupe/notifications/`));
      }, []);

    return (
        <ChatPage notif={notif}/>
    );
};

export default MemberPage;
